pragma solidity ^0.8.0;

library SortedLinkedList {
    struct Node {
        address key;
        uint value;
        address prev;
        address next;
    }

    struct List {
        mapping(address => Node) nodes;
        address head;
        address tail;
        uint size;
    }

    function insert(List storage self, address key, uint value) internal {
        require(key != address(0), "Invalid address");

        if (self.size == 0) {
            self.head = key;
            self.tail = key;
            self.nodes[key] = Node({key: key, value: value, prev: address(0), next: address(0)});
        } else {
            address current = self.head;
            while (current != address(0) && self.nodes[current].value > value) {
                current = self.nodes[current].next;
            }

            if (current == address(0)) {
                self.nodes[self.tail].next = key;
                self.nodes[key] = Node({key: key, value: value, prev: self.tail, next: address(0)});
                self.tail = key;
            } else {
                if (current == self.head) {
                    self.nodes[key] = Node({key: key, value: value, prev: address(0), next: self.head});
                    self.nodes[self.head].prev = key;
                    self.head = key;
                } else {
                    address prev = self.nodes[current].prev;
                    self.nodes[prev].next = key;
                    self.nodes[key] = Node({key: key, value: value, prev: prev, next: current});
                    self.nodes[current].prev = key;
                }
            }
        }

        self.size++;
    }

    function remove(List storage self, address key) internal {
        require(key != address(0), "Invalid address");
        require(self.size > 0, "List is empty");

        Node memory node = self.nodes[key];
        if (node.prev != address(0)) {
            self.nodes[node.prev].next = node.next;
        } else {
            self.head = node.next;
        }

        if (node.next != address(0)) {
            self.nodes[node.next].prev = node.prev;
        } else {
            self.tail = node.prev;
        }

        delete self.nodes[key];
        self.size--;
    }

    function getTop(List storage self, uint n) internal view returns (address[] memory) {
        require(n <= self.size, "Requested more elements than available");

        address[] memory top = new address[](n);
        address current = self.head;
        for (uint i = 0; i < n; i++) {
            top[i] = current;
            current = self.nodes[current].next;
        }

        return top;
    }

    function exists(List storage self, address key) internal view returns (bool) {
        return self.nodes[key].key != address(0);
    }
}","keccak256":"0x1a729136c0c5ee2417b3193b9c11eb8bf4e8d6071ae3664c67b059ae27acb12c","license":"MIT"},"contracts/periphery/contracts/access-control/SuAccessRoles.sol":{"content":"// SPDX-License-Identifier: BSL 1.1

pragma solidity ^0.8.0;

/**
 * @title SuAccessRoles Library
 * @dev SuAuthenticated and SuAccessControlSingleton need to have this constants
 * Hierarchy:
 *      1. DAO - can give admins and system roles
 *      2.1. Admin - can set Alerters
 *      2.2. System - includes Minter, Liquidation, Reward and Disabler roles, don't have access to give some roles.
 *      3. Alerter - can send alerts and trigger rate limits, don't have access to give some roles.
 */
abstract contract SuAccessRoles {
    bytes32 public constant ADMIN_ROLE = 0x00;

    bytes32 public constant DAO_ROLE = keccak256("DAO_ROLE");

    bytes32 public constant ALERTER_ROLE = keccak256("ALERTER_ROLE");

    // system roles
    bytes32 public constant MINT_ACCESS_ROLE = keccak256("MINT_ACCESS_ROLE");
    bytes32 public constant LIQUIDATION_ACCESS_ROLE = keccak256("LIQUIDATION_ACCESS_ROLE");
    bytes32 public constant REWARD_ACCESS_ROLE = keccak256("REWARD_ACCESS_ROLE");
    // bytes32 public constant SYSTEM_ROLE = keccak256("SYSTEM_ROLE");
    bytes32 public constant DISABLER_ROLE = keccak256("DISABLER_ROLE");
    bytes32 public constant CDP_ACCESS_ROLE = keccak256("CDP_ACCESS_ROLE");
    bytes32 public constant VOTING_ESCROW_ROLE = keccak256("VOTING_ESCROW_ROLE");
}
