pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import "../interfaces/ITopStakers.sol";
import "../../periphery/contracts/access-control/SuAuthenticated.sol";
import "../../libraries/SortedLinkedList.sol";

import "hardhat/console.sol";

struct LockedBalance {
    int128 amount;
    int128 delegated;
    uint256 end;
    address delegatee;
}
interface VeTokenLike {
    function balanceOf(address _owner) external view returns (uint256);
    function locked(address user) external view returns (LockedBalance memory);
}

contract TopStakers is SuAuthenticated, ITopStakers {
    using SortedLinkedList for SortedLinkedList.List;
    SortedLinkedList.List private stakers;

    uint256 public topN;
    uint256 public minStakingAmount;
    VeTokenLike public veToken;

    function initialize(address _authControl, address _veToken) public initializer {
        __suAuthenticatedInit(_authControl);
        veToken = VeTokenLike(_veToken);
        topN = 21;
        minStakingAmount = 0;
    }

    function changeTopN(uint256 newTopN) external onlyAdmin {
        topN = newTopN;
    }

    function changeVeToken(address _veToken) external onlyAdmin {
        veToken = VeTokenLike(_veToken);
    }

    function changeMinStakingAmount(uint256 _minStakingAmount) external onlyAdmin {
        minStakingAmount = _minStakingAmount;
    }

    function subscribe() external {
        uint256 amount = veToken.balanceOf(msg.sender);
        if (amount <= minStakingAmount) revert AmountMustBeMoreThatMinimum();

        if (stakers.exists(msg.sender)) {
            stakers.remove(msg.sender);
        }

        stakers.insert(msg.sender, amount);
    }

    function _unsubscribe(address user) internal {
        if (!stakers.exists(user)) revert NotStakerFound();
        stakers.remove(user);
    }

    function unsubscribe() external {
        _unsubscribe(msg.sender);
    }

    function unsubscribeOnBehalf(address user) external onlyVotingEscrow {
        _unsubscribe(user);
    }

    // We can update later with while(all topN are not expired) fund expired topStaker
    function cleanExpiredTopStakers() external {
        uint count = 0;
        address current = stakers.head;
        while (current != address(0) && count < topN) {
            address staker = current;
            bool isExpired = veToken.locked(staker).end < block.timestamp;

            current = stakers.nodes[staker].next;

            if (isExpired) {
                _unsubscribe(staker);
            }

            count++;
        }
    }

    function isStaker(address user) public view returns (bool) {
        bool isExpired = veToken.locked(user).end < block.timestamp;

        return !isExpired && stakers.exists(user);
    }

    function isTopStaker(address staker) public view returns (bool) {
        if (!stakers.exists(staker)) {
            return false;
        }

        uint count = 0;
        address current = stakers.head;
        while (current != address(0) && count < topN) {
            if (current == staker) {
                return true;
            }
            current = stakers.nodes[current].next;
            count++;
        }
        return false;
    }

    function getTopStakers() public view returns (address[] memory) {
        return stakers.getTop(topN);
    }

    function getStakersLength() public view returns (uint256) {
        return stakers.size;
    }
}
